sources.base\\main.scss:
@import "./reset.scss";
@import "./fonts.scss";
@import "./variables.scss";

* {
	font-family: 'Montserrat', sans-serif;
	font-size: 14px;
	line-height: 24px;
}

p {
	color: $color-ds75;
}

h1 {
	font-size: 24px;
	line-height: 28px;
}

h2 {
	font-size: 19px;
	line-height: 22px;
}

h3 {
	font-size: 12px;
	line-height: 15px;
	text-transform: uppercase;
}

.container {
	max-width: 1157px;
	margin: 0 auto;
}

.material-icons {
	font-family: 'Material Icons';
	font-weight: normal;
	font-style: normal;
	font-size: 24px;
	display: inline-flex;
	vertical-align: middle;
	line-height: 10px;
	text-transform: none;
	letter-spacing: normal;
	word-wrap: normal;
	white-space: nowrap;
	direction: ltr;
}

sources.modules\\header.scss:
.container {
	display: flex;
	justify-content: flex-end;
	align-items: center;
}

.header__logo {
	flex-grow: 1;
}

.nav {
	display: flex;
	justify-content: space-between;
	padding-top: 26px;
	padding-bottom: 23px;
	margin: 0;
	list-style-type: none;

	&__link {
		color: $color-ds50;
		font-size: 14px;
		font-weight: 300;
	}

	&__link:hover {
		color: $color-ds50;
	}

	&__item {
		padding-right: 20px;
	}

}

.button_default {

	margin: 0 auto;
	background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
	border-radius: 22px;
	border: none;
	padding: 2px;
	margin-right: 20px;

	h3 {
		margin: 0;
		color: #BC9CFF;
		background: #fff;
		border-radius: 22px;
		line-height: 14px;
		padding: 8px 19px;

	}
}

.button_gradient {
	color: #fff;
	margin: 0 auto;
	font-size: 12px;
	font-weight: bold;
	line-height: 14px;
	background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
	border-radius: 22px;
	border: none;
	padding: 10px 19px;
	text-transform: uppercase;

}

sources.modules\\footer.scss:
.footer {
	&__main {
		margin-top: 100px;
	}

	&__main div {
		justify-content: space-between;
		align-items: flex-start;
	}

	&__main li {
		margin-top: 20px;
	}

	&__main ul {
		list-style-type: none;
		padding: 0px;
		margin: 0px;
	}

	&__main a {
		color: $color-ds50;
		font-size: 14px;
		font-weight: 300;
		width: 143px;
	}

	&__main a:hover {
		color: $color-ds50;
	}

	&__subscribe p {
		margin: 20px 0 0;
	}

	&__subscribe form {
		border: 1px solid $color-ds25;
		border-radius: 4px;
		height: 44px;
		width: 260px;
		margin-top: 20px;
	}

	&__subscribe form:hover {
		border: 1px solid $color-ds50;
	}

	&__subscribe input {
		border-radius: 4px;
		border: none;
		height: 42px;
		outline: none;
		text-indent: 15px;
		width: 216px;
	}

	&__subscribe input::-webkit-input-placeholder {
		color: $color-ds25;
	}

	&__subscribe button {
		position: absolute;
		background: url(../img/arrow_forward.svg) no-repeat 50% 50%;
		height: 44px;
		width: 44px;
		border: none;
	}

	&__info,
	&__subscribe {
		width: 260px;
	}

	&__info p {
		margin-top: 20px;
	}

	&__widgets {
		border-top: 1px solid $color-ds25;
		margin-top: 100px;
	}

	&__widgets div {
		justify-content: space-between;
	}

	&__social {
		display: flex;
		justify-content: center;
		padding: 24px 0;
		margin: 0;
	}

	&__twitter,
	&__facebook,
	&__instagram {
		display: inline-block;
		width: 22px;
		height: 22px;
		background-repeat: no-repeat;
		background-position: center center;
	}

	&__item {
		margin-left: 20px;
		list-style-type: none;
	}

	&__twitter {
		background-image: url(../img/twitter.svg);
	}

	&__facebook {
		background-image: url(../img/facebook.svg);
	}

	&__instagram {
		background-image: url(../img/instagram.svg);
	}
}

